use myDB;
drop table if exists tbl_iolist;
create table if not exists tbl_iolist(

	IO_SEQ bigint primary key,
	IO_DATE varchar(10),
	IO_INOUT varchar(2),
	IO_QTY int,
	IO_PRICE int,
	IO_AMT int,
	IO_PCODE char(5),
	IO_BCODE char(4)

);
